import {View, Text} from 'react-native';

class ViewExam extends React.Component {
  render () {
    return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>ViewExam</Text>
   </View>
 );

  }
}

export default ViewExam;
